import './App.css';

import Inicio from './Inicio.js';
//Importar componentes 
import CompShowLibros from './libro/ShowLibros.js';
import CompCreateLibro from './libro/CreateLibro.js';
import CompEditLibro from './libro/EditLibro.js';
//Importar router
import { BrowserRouter, Route, Routes } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Inicio />} />
          <Route path='/' element={ <CompShowLibros />}/>
          <Route path='/create' element={ <CompCreateLibro />}/>
          <Route path='/edit/:id_libro' element={ <CompEditLibro />}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
